•our ability to manufacture and sell commercial quantities of aficamten product to the market;
•our ability to gain market access, successfully commercialize aficamten and secure coverage and adequate reimbursement in approved indications;
•product acceptance by physicians and other health care providers;
•protection of our intellectual property, including our ability to enforce our intellectual property rights against potential generic competition; and
•the availability of substantial capital resources to fund development and commercialization activities.
Competition for Omecamtiv Mecarbil We believe the principal competition for omecamtiv mecarbil, if ultimately approved for sales and marketing by FDA and/or other regulatory agencies for the treatment of HFrEF includes generic drugs, such as milrinone, dobutamine or digoxin, categories of generic therapies, including beta-blockers, angiotensin-converting enzyme (ACE) inhibitors, angiotensin receptor blockers (ARBs), Mineralocorticoid receptor antagonists (MRAs), and branded drugs such as Corlanor® (ivabradine), Entresto® (sacubitril/valsartan) and Verquvo® (vericiguat). Omecamtiv mecarbil could also potentially compete against other novel drug candidates and therapies in development, such as those being developed by, but not limited to, Novartis AG, Merck & Co., Inc., Bayer AG, AstraZeneca PLC and Bristol-Myers Squibb Company. Omecamtiv mecarbil may also compete with currently approved drugs, such as in the SGLT2 inhibitor class, that have either expanded or are planning to expand their labels to include treatment of patients with heart failure, including Forxiga® (dapagliflozin), Invokana® (canagliflozin), and Jardiance® (empagliflozin). The competitive landscape for HFrEF is already crowded and evolving rapidly, especially given the addition of SGLT2 inhibitors as AHA/ACC/HFSA guideline directed medical therapy for HFrEF. SGLT2 inhibitors have steadily gained market share over the previous two years. In addition, there are a number of medical devices both marketed and in development for the potential treatment of patients living with heart failure.

