In the United States, the FDA regulates drugs under the Federal Food, Drug and Cosmetic Act and implementing regulations. The process required by the FDA before our drug candidates may be marketed in the United States generally involves the following:
•completion of extensive preclinical laboratory tests, preclinical animal studies and formulation studies, all performed in accordance with the FDA’s good laboratory practice regulations;
•submission to the FDA of an IND, which must become effective before clinical trials may begin;
•performance of adequate and well-controlled clinical trials to establish the safety and efficacy of the drug candidate for each proposed indication in accordance with GCP;
•submission of a NDA to the FDA, which must usually be accompanied by payment of a substantial user fee;
•satisfactory completion of an FDA preapproval inspection of the manufacturing facilities at which the product is produced to assess compliance with cGMP regulations and FDA audits of select clinical investigator sites to assess compliance with GCP; and
•FDA review and approval of the NDA prior to any commercial marketing, sale or shipment of the drug. Similar regulatory procedures generally apply in countries outside of the United States. This testing and approval process requires substantial time, effort and financial resources, and we cannot be certain that any approvals for our drug candidates will be granted on a timely basis, if at all.

•they might determine that a drug candidate is not safe or effective;
