•they might not approve our, our partner’s or the contract manufacturer’s processes or facilities; or
•they might change their approval policies or adopt new regulations. Even if we receive regulatory approval to manufacture and sell a drug in a particular regulatory jurisdiction, other jurisdictions’ regulatory authorities may not approve that drug for manufacture and sale. Moreover, the refusal of one regulatory authority to approve one of our drug candidates may influence the decision-making of another regulatory authority in a different jurisdiction in a manner that is adverse to us. For example, FDA's recent CRL in response to our NDA for omecamtiv mecarbil may influence EMA to decline to approve our MAA for omecamtiv mecarbil in the E.U. or other regulatory authorities in other jurisdictions to decline to approve our potential marketing applications for omecamtiv mecarbil in such other jurisdictions.

