Risks Specific to our Company in connection with our Commercial Operations
Our competitors may develop drugs that are less expensive, safer and/or more effective than ours, which may diminish or eliminate the commercial success of any drugs that we may commercialize.
We compete with companies that have developed drugs or are developing drug candidates for cardiovascular diseases, diseases and conditions associated with muscle weakness or wasting and other diseases for which our drug candidates may be useful treatments.
Our competitors may:
•develop drug candidates and market drugs that are less expensive or more effective than our future drugs;
•commercialize competing drugs before we or our partners can launch any drugs developed from our drug candidates;
•hold or obtain proprietary rights that could prevent us from commercializing our products;
•initiate or withstand substantial price competition more successfully than we can;
•more successfully recruit skilled scientific workers and management from the limited pool of available talent;
•more effectively negotiate third-party licenses and strategic alliances;
•take advantage of acquisition or other opportunities more readily than we can;
•develop drug candidates and market drugs that increase the levels of safety or efficacy that our drug candidates will need to show in order to obtain regulatory approval; or
•introduce therapies or market drugs that render the market opportunity for our potential drugs obsolete. We will compete for market share against large pharmaceutical and biotechnology companies and smaller companies that are collaborating with larger pharmaceutical companies, new companies, academic institutions, government agencies and other public and private research organizations. Many of these competitors, either alone or together with their partners, may develop new drug candidates that will compete with ours. Many of these competitors have larger research and development programs or substantially greater financial resources than we do. Our competitors may also have significantly greater experience in:

•developing drug candidates;
•undertaking preclinical testing and clinical trials;
•building relationships with key customers and opinion-leading physicians;
38
•obtaining and maintaining FDA and other regulatory approvals of drug candidates;
•formulating and manufacturing drugs; and
•launching, marketing and selling drugs. If our competitors market drugs that are less expensive, safer and/or more efficacious than our potential drugs, or that reach the market sooner than our potential drugs, we may not achieve commercial success. In addition, the life sciences industry is characterized by rapid technological change. If we fail to stay at the forefront of technological change, we may be unable to compete effectively. Our competitors may render our technologies obsolete by improving existing technological approaches or developing new or different approaches, potentially eliminating the advantages in our drug discovery process that we believe we derive from our research approach and proprietary technologies.

•introduction of competitive drugs to the market;
•clinical safety and efficacy of alternative drugs or treatments;
•cost-effectiveness;
•availability of coverage and reimbursement from health maintenance organizations and other third-party payors;
•convenience and ease of administration;
•prevalence and severity of adverse events;
•other potential disadvantages relative to alternative treatment methods; or
•insufficient patient support;
•insufficient marketing and distribution support.
If our drugs fail to achieve market acceptance, we may not be able to generate significant revenue and our business would suffer.
