Risks Specific to our Company in connection with our Intellectual Property
Our success depends substantially upon our ability to obtain and maintain intellectual property protection relating to our drug candidates, compounds and research technologies. We own, co-own or hold exclusive licenses to a number of U.S. and foreign patents and patent applications directed to our drug candidates, compounds and research technologies. Our success depends on our ability to obtain patent protection both in the United States and in other countries for our drug candidates, their methods of manufacture and use, and our technologies. Our ability to protect our drug candidates, compounds and technologies from unauthorized or infringing use by third parties depends substantially on our ability to obtain and enforce our patents. If our issued patents and patent applications, if granted, do not adequately describe, enable or otherwise provide coverage of our technologies and drug candidates, we, our licensors or our licensees would not be able to exclude others from developing or commercializing these drug candidates. Furthermore, the degree of future protection of our proprietary rights is uncertain because legal means may not adequately protect our rights or permit us to gain or keep our competitive advantage. If we are unable to obtain and maintain sufficient intellectual property protection for our technologies and drug candidates, or if the scope of the intellectual property protection obtained is not sufficiently broad, our competitors could develop and commercialize drug candidates similar or identical to ours, and our ability to successfully commercialize product candidates that we may pursue may be impaired.

