•if a license is available from a holder, we may have to pay substantial royalties or grant cross-licenses to our patents or other proprietary rights.
If any of these events occur, it could significantly harm our business and negatively affect our stock price.
We may undertake infringement or other legal proceedings against third parties, causing us to spend substantial resources on litigation and exposing our own intellectual property portfolio to challenge. Third parties may infringe our patents. To prevent infringement or unauthorized use, we may need to file infringement suits, which are expensive and time-consuming. In an infringement proceeding, a court may decide that one or more of our patents is invalid, unenforceable, or both. In such case third parties may be able to use our technology without paying licensing fees or royalties. Even if the validity of our patents is upheld, a court may refuse to stop the other party from using the technology at issue on the ground that the other party’s activities are not covered by our patents. Policing unauthorized use of our intellectual property is difficult, and we may not be able to prevent misappropriation of our proprietary rights, particularly in countries where the laws may not protect such rights as fully as in the United States. In addition, third parties may affirmatively challenge our rights to, or the scope or validity of, our patent rights.

As of December 31, 2023, we had $617.5 million of debt recorded on the balance sheet comprised of the RP Loan Agreement and the 2026 and 2027 Convertible Notes.
We may also incur additional indebtedness to meet future financing needs. Our indebtedness could have significant negative consequences for our security holders and our business, results of operations and financial condition by, among other things:
•increasing our vulnerability to adverse economic and industry conditions;
•limiting our ability to obtain additional financing;
•requiring the dedication of a substantial portion of our cash flow from operations to service our indebtedness, which will reduce the amount of cash available for other purposes;
•limiting our flexibility to plan for, or react to, changes in our business;
•diluting the interests of our existing stockholders as a result of issuing shares of our common stock upon conversion of the Convertible Notes; and
•placing us at a possible competitive disadvantage with competitors that are less leveraged than us or have better access to capital. Our business may not generate sufficient funds, and we may otherwise be unable to maintain sufficient cash reserves, to pay amounts due under our indebtedness and our cash needs may increase in the future. In addition, any required repurchase of the Convertible Notes for cash as a result of a fundamental change would lower our current cash on hand such that we would not have those funds available for us in our business. Further any future indebtedness that we may incur may contain financial and other restrictive covenants that limit our ability to operate our business, raise capital or make payments under our other indebtedness. If we fail to comply with these covenants or to make payments under our indebtedness when due, then we would be in default under that indebtedness, which could, in turn, result in that and our other indebtedness becoming immediately payable in full.

