•the payments due for interest on the term loan and convertible debt; We have incurred an accumulated deficit of approximately $2.1 billion since inception and there can be no assurance that we will attain profitability. We are subject to risks common to clinical-stage companies including, but not limited to, development of new drug candidates, dependence on key personnel, and the ability to obtain additional capital as needed to fund our future plans. Our liquidity will be impaired if sufficient additional capital is not available on terms acceptable to us, if at all. Until we achieve profitable operations, we intend to continue to fund operations through payments from strategic collaborations, additional sales of equity securities, grants and other financings. We have never generated revenues from commercial sales of our drugs and may not have drugs to market for at least several years, if ever. Therefore, our success is dependent on our ability to obtain additional capital by entering into new strategic collaborations and/or through financings, and ultimately on our and our collaborators’ ability to successfully develop and market one or more of our drug candidates. We cannot be certain that sufficient funds will be available from such collaborators or financings when needed or on satisfactory terms. Additionally, there can be no assurance that any of our drug candidates will be accepted in the marketplace or that any future products can be developed or manufactured at an acceptable cost. These factors could have a material adverse effect on our future financial results, financial position and cash flows.
